import React from "react";
import "./Footer.css"

function Footer() {
  return (
    <div>
      <nav className="footernav">

        <div className="footernav1">
            <ul>
          <li> Wallawaya Road,Pillewela,Buttala</li>
          </ul>
        </div>
      </nav>
    </div>
  );
}

export default Footer;
